import React, { Component } from "react";
import { Link, Route } from "react-router-dom";
//style importer
import * as style__ from "./style";
//component importer
//utils importer
interface Props {
  isFormDisPlay: (status: boolean) => void;
  stateUser: boolean;
}

class SignInForm extends Component<Props, {}> {
  // state = initState;

  formDisplay = () => {
    this.props.isFormDisPlay(!this.props.stateUser);
  };

  formRegisterDisplay = () => {};

  formSignin = () => {
    return (
      <div
        style={{
          position: "absolute",
          top: "50%",
          left: "50%",
          transform: "translate(-50%,-50%)",
        }}
      >
        <form action="">
          <label>
            {" "}
            CMND: <input type="text" />
          </label>
          <hr />
          <label>
            Password: <input type="password" />
          </label>
          <hr />
          <Link to="/register" onClick={() => this.formRegisterDisplay()}>
            Bạn chưa có tài khoản ?
          </Link>
          <hr />
          <span onClick={this.formDisplay}>Cancel</span>
        </form>
      </div>
    );
  };

  render() {
    return <React.Fragment>{this.formSignin()}</React.Fragment>;
  }
}

export default SignInForm;
